import React, { useState } from 'react'
//styles
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Badge from 'react-bootstrap/Badge'
import Button from 'react-bootstrap/Button'
//import other pages
import DashboardManagerDetails from "./DashboardManagerDetails"
import ManagerProfile from "./ManagerProfile"
//import Requests from "./Requests"
//import Update from "./Update"
import { useHistory } from "react-router-dom"

export default function ManagerHeader() {
    const history = useHistory()

    const [key, setKey] = useState('home');


        //logout 
        async function logout() {

            try {
                //empty all catches
    
    
                //and then direct to home page
                history.push('/')
            } catch (error) {
                console.log(error)
            }
    
        }
    return (
        <div className="col-sm-100 offset-sm-0">
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                <Navbar.Brand >{`John Doe User`}</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto">
                        <Badge pill variant="dark">{'your Last Login was: 31/02/2021 5:00 pm '}</Badge>
                    </Nav>
                    <Nav>
                        <Button  variant="secondary">Logout</Button>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
            <br />
            <Tabs
                id="controlled-tab-example"
                activeKey={key}
                onSelect={(k) => setKey(k)}
            >
                <Tab eventKey="home" title="Dashboard">
                    <DashboardManagerDetails />
                </Tab>
                <Tab eventKey="profile" title="Profile">
                    <ManagerProfile />
                </Tab>
                {
                    /*
                    <Tab eventKey="requests" title="Requests" >
                        <Requests/>
                    </Tab>
                    <Tab eventKey="update" title="Update" >
                        <Update/>
                    </Tab>
                    */
                }

            </Tabs>
        </div>
    );
}
